import Header from "./Header";
import Footer from "./Footer";
const Layout = (props) => {
  return (
    <div
      style={{
        minHeight: "100vh",
        display: "`flex`",
        flexDirection: "column",
        justifyContent: "between",
      }}
    >
      <Header />
      <div className="layout">{props.children}</div>
      <Footer />
    </div>
  );
};

export default Layout;
